 The question is asking for the value of $x$ in the equation $x^2 - 4x + 3 = 0$. We can solve this by factoring the quadratic equation:
\begin{align*}
x^2 - 4x + 3 &= 0 \\
(x - 1)(x - 3) &= 0.
\end{align*}
So the solutions are $x = 1$ and $x = 3$. The question asks for the value of $x$ that is greater than 1, so the answer is $3$.

